# Carrega o modelo de língua em português
nlp = spacy.load('pt_core_news_sm')

"""<h3><b>2 - Listagem de perguntas do FAQ</b></h3>
<h6>Adiciona-se lista com perguntas do FAQ para verificação posterior da similiridade com as perguntas dos usuários.</h6>
"""

# Lista de perguntas FAQ
perguntas_faq = [
    "Como posso abrir uma conta no Banco do Brasil?",
    "Menor de idade pode ter conta no Banco do Brasil?",
    "Que documentos são necessários para abrir uma conta?",
    "Posso incluir outra pessoa como titular de minha conta, o que devo fazer?",
    "É necessário assinar algum documento para abrir a conta?",
    "O que mais preciso saber para abrir uma conta bancária?",
    "Quais são as formas para acessar o autoatendimento do Banco do Brasil?",
    "Como desbloquear a senha bloqueada por digitação errada?",
    "Moro fora do Brasil, como desbloquear a senha por digitação errada?",
    "Onde posso cadastrar a senha?",
    "Onde posso alterar as minhas senhas?",
    "Posso bloquear as minhas senhas?",
    "Como posso desbloquear as minhas senhas?",
    "Onde posso cancelar o meu Código de Acesso?"
    ]

"""<h3><b>3 - Carrega corpus do FAQ</b></h3>
<h6>Carrega-se um corpus com as perguntas frequentes do banco, disponibilizados em arquivo de formato texto, o qual pode ser editado a qualquer momento, tanto para acresecentar perguntas novas, como para excluir e editar perguntas existentes.</h6>
"""

# Abre arquivo e converte em minúsculas
f = open('faq-corpus.txt','r')
raw = f.read().lower()

# Segmenta sentenças e tokeniza o corpus
sent_tokens = nltk.sent_tokenize(raw)
word_tokens = nltk.word_tokenize(raw)

# Mostra sentenças segmentadas
sent_tokens

# Mostra os primeiros 15 tokens do corpus
word_tokens[0:15]

"""<h3><b>4 - Normalização e redução de dimensionalidade</b></h3>
<h6>Definem-se funções que utilizam o processo de <i>Stemming</i> nos textos, para normalizar termos similares em única forma. Por exemplo. "gato", "gatos", "gata" e "gatas" são normalizados para "gat".</h6>
"""

stemmer = nltk.stem.RSLPStemmer()

def LemTokens(tokens):
    return [stemmer.stem(token) for token in tokens]

remove_punct_dict = dict((ord(punct), None) for punct in string.punctuation)

def LemNormalize(text):
    return LemTokens(nltk.word_tokenize(text.lower().translate(remove_punct_dict)))

"""<h3><b>5 - Controle de saudações</b></h3>
<h6>Define-se uma função para tratar saudações feitas ao chatbot.</h6>
"""

saudacoes = ("olá", "oi", "ei", "blz", "bom dia", "boa tarde", "boa noite","como vai", "tudo bem")
respostas = ["Oi", "Olá"]
def greeting(sentence):
    for word in sentence.split():
        if word.lower() in saudacoes:
            return random.choice(respostas)

"""<h3><b>6 - Controle de agradecimento</b></h3>
<h6>Define uma função para verificar se usuário empregou expressão de agradecimento.</h6>
"""

agradecimentos = ("obrigado", "muito obrigado", "obrigada", "muito obrigada", "agradecido", "agradecida", "grato", "grata")
def isThanks(sentence):
    for word in sentence.split():
        if word.lower() in agradecimentos:
            return True
    return False

"""<h3><b>7 - Controle de despedidas</b></h3>
<h6>Define função para verificar se usuário empregou expressão de despedida.</h6>
"""

despedidas = ("tchau", "até logo", "fui", "adeus", "até mais", "até breve", "adeus")
def isEnding(sentence):
    for word in sentence.split():
        if word.lower() in despedidas:
            return True
    return False

"""<h3><b>8 - Controle de respostas</b></h3>
<h6>Define-se uma função para controlar respostas dadas ao usuário. Usa-se a biblioteca Spacy para processar e calcular a similaridade entre as perguntas do FAQ e do usuário. A função percorre as FAQ, calcula a similaridade de coseno entre a pergunta do usuário e cada FAQ e, com base na maior similaridade encontrada, determina se uma resposta relevante pode ser gerada. Se a similaridade estiver abaixo de certo limite, o chatbot solicita ao usuário que reformule a pergunta. Caso contrário, o chatbot fornece a resposta correspondente à pergunta mais similar da FAQ.</h6>
"""

def response(user_response):
    warnings.simplefilter('ignore')
    robo_response=''
    pergunta_relacionada = ''

    max_similarity = 0.0
    best_match_index = -1

    for idx, perg_faq in enumerate(perguntas_faq):
      perg_faq_doc = nlp(perg_faq)
      user_doc = nlp(user_response)
      similarity = perg_faq_doc.similarity(user_doc)

      if similarity > max_similarity:
        max_similarity = similarity
        best_match_index = idx

    if max_similarity < 0.2:
      robo_response= "Você poderia reformular sua pergunta?"
    else:
      robo_response = sent_tokens[best_match_index]
      pergunta_relacionada = perguntas_faq[best_match_index]

    return robo_response, pergunta_relacionada

"""<h3><b>9 - Executa o chatbot</b></h3>
<h6>Trecho de código para controle geral da aplicação. A seguir, há alguns exemplos de perguntas que podem ser feitas ao chatbot:

- Como posso abrir uma conta no banco?
- Quais são os documentos necessários?
- O que mais preciso saber para abrir uma conta?
- Quero incluir outra pessoa como titular em minha conta, o que devo fazer?
- Quais são as formas para acessar o autoatendimento?
- Como desbloquear senha bloqueada por digitação errada?
- Onde posso alterar a minha senha?
- Onde cancelo meu código de acesso?</h6>
"""

flag=True

print("FAQBOT: Olá, sou o faqbot. Posso responder perguntas sobre abertura de conta no banco e uso de senhas.")

while flag:
    # Obtém entrada do usuário
    user_response = input()
    user_response=user_response.lower()
    # Caso não seja despedida
    if not isEnding(user_response):
        # Caso seja agradecimento
        if isThanks(user_response):
            flag=False
            print("FAQBOT: Disponha. Estou aqui para lhe ajudar.")
        else:
            # Caso seja uma saudação inicial
            if greeting(user_response) is not None:
                print("FAQBOT: " + greeting(user_response))
            else:
                # Caso seja um pergunta válida
                print("FAQBOT: ", end="")
                robo_response, pergunta_relacionada = response(user_response)
                print('\x1b[1;31m'+ robo_response +'\x1b[0m')
                if pergunta_relacionada:
                  print("Pergunta relacionada do FAQ: " + pergunta_relacionada)
    else:
        flag=False
        print("FAQBOT: Até mais!")